closed_insurance.query:
a = load "${App.Datasets.HLS_Patient8_tp.FullyQualifiedName}";
a = filter a by 'HealthCloudGA_InsuranceType__c' == "Medicare";
b = filter a by 'IsClosed' == "true";
c = group a by all full, b by all;
c = foreach c generate round(100*(count(b)/count(a)),1) as 'conversion_pct';

insurance.query:
q = load "${App.Datasets.HLS_Patient8_tp.FullyQualifiedName}";
q = group q by 'HealthCloudGA_InsuranceType__c';
q = foreach q generate 'HealthCloudGA_InsuranceType__c' as 'HealthCloudGA_InsuranceType__c', count() as 'count';
q = order q by 'HealthCloudGA_InsuranceType__c' asc;
q = limit q 2000;

