conversion_time.query:
dataset = load "${App.Datasets.HLS_Patient8_tp.FullyQualifiedName}";
a = group dataset by all;
a = foreach a generate avg('OpportunityAge') as 'avg_OpportunityAge', case when avg('OpportunityAge') < {{coalesce(cell(conversion_age_all.result, 0, "avg_OpportunityAge"),0).asString()}} then "This Patient (on track)" else "This Patient (behind)" end as 'ConversionType', 1 as 'order';

dataset = filter dataset by 'IsClosed' == "true";
b = filter dataset by 'HealthCloudGA_Specialty__c' == "Cardiology";
b = group b by all;
b = foreach b generate avg('OpportunityAge') as 'avg_OpportunityAge', "Avg Specialty" as 'ConversionType', 2 as 'order';

c = filter dataset by 'HealthCloudGA_TypeOfService__c' == "Surgery";
c = group c by all;
c = foreach c generate avg('OpportunityAge') as 'avg_OpportunityAge', "Avg Type of Service" as 'ConversionType', 3 as 'order';

d = filter dataset by 'HealthCloudGA_InsuranceType__c' == "Medicare";
d = group d by all;
d = foreach d generate avg('OpportunityAge') as 'avg_OpportunityAge', "Avg Insurance Type" as 'ConversionType', 4 as 'order';

e = group dataset by all;
e = foreach e generate avg('OpportunityAge') as 'avg_OpportunityAge', "Avg Overall" as 'ConversionType', 5 as 'order';

f = union a,b,c,d,e;
f = order f by 'order' asc;

