comparison_text_conversion_age.query:
q = load "${App.Datasets.HLS_Patient8_tp.FullyQualifiedName}";
q = group q by all;
q = foreach q generate {{coalesce(cell(conversion_age.result, 0, "avg_OpportunityAge"),0).asString()}} as 'selected_patient', {{coalesce(cell(conversion_age_all.result, 0, "avg_OpportunityAge"),0).asString()}} as 'all';
q = foreach q generate case when 'selected_patient' > 'all' then "falling behind" when 'selected_patient' < 'all' then "on track" else "on track" end as 'conversion_age_text', case when 'selected_patient' > 'all' then "Behind" when 'selected_patient' < 'all' then "On Track" else "On Track" end as 'conversion_age_header', case when 'selected_patient' > 'all' then "#A40006" when 'selected_patient' < 'all' then "#16AA25" else "#16AA25" end as 'conversion_age_color';

