description_text.query:
q = load "${App.Datasets.HLS_Patient8_tp.FullyQualifiedName}";
q = group q by all;
q = foreach q generate count() as 'count', case when first('IsClosed') == "true" then "This patient booked an appointment in {{coalesce(cell(conversion_age.result, 0, "avg_OpportunityAge"),"0").asString()}} days. The average time for booking an appointment is {{coalesce(cell(conversion_age_all.result, 0, "avg_OpportunityAge"),"0").asString()}} days." else "This patient has not booked an appointment and has been open for {{coalesce(cell(conversion_age.result, 0, "avg_OpportunityAge"),"0").asString()}} days. The average time for booking an appointment is {{coalesce(cell(conversion_age_all.result, 0, "avg_OpportunityAge"),"0").asString()}} days." end as 'description_text';

