comparison_text.query:
q = load "${App.Datasets.HLS_Patient8_tp.FullyQualifiedName}";
q = group q by all;
q = foreach q generate {{coalesce(cell(closed_specialty.result, 0, "conversion_pct"),0).asString()}} as 'specialty', {{coalesce(cell(closed_insurance.result, 0, "conversion_pct"),0).asString()}} as 'insurance', {{coalesce(cell(closed_type_of_service.result, 0, "conversion_pct"),0).asString()}} as 'type_of_service', {{coalesce(cell(closed_all.result, 0, "conversion_pct"),0).asString()}} as 'all';
q = foreach q generate case when 'specialty' < 'all' then "worse than" when 'specialty' > 'all' then "better than" else "the same as" end as 'specialty_text', case when 'insurance' < 'all' then "worse than" when 'insurance' > 'all' then "better than" else "the same as" end as 'insurance_text', case when 'type_of_service' < 'all' then "worse than" when 'type_of_service' > 'all' then "better than" else "the same as" end as 'type_of_service_text';

